import List from '../component/List'

export default function Main({ list, book, setBook }){
  const items = list.slice(0,4);
  return(
    <article id='main'>
      <section>
      <dl>
        <dt>상품 리스트</dt>
        <dd>
          {items.map((item)=>{
            return <List item={item} book={book} setBook={setBook} />
          })}
        </dd>
        <dt>북마크 리스트</dt>
        <dd>
          {items.map((item)=>{
            return <List item={item} book={book} setBook={setBook} />
          })}
        </dd>
      </dl>
      </section>
    </article>
  )
}
